import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input field
    await page.waitForSelector('#eventSearchInput');
    await page.fill('#eventSearchInput', 'nonexistent');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input.png'));

    // Click the search button
    await page.waitForSelector('button.search-btn');
    await page.click('button.search-btn');
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_button_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_button_clicked.png'));

    // Check for no results scenario
    const noResultsSelector = 'text=No results found'; // Adjust based on actual no results message
    const noResultsVisible = await page.isVisible(noResultsSelector);

    // Take screenshot of the results area
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_results_area.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_results_area.png'));

    return {
      success: true,
      action: noResultsVisible ? "No results found for the search term 'nonexistent'" : "Results found unexpectedly",
      extractedData: { noResultsVisible },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

