    const noResultsMessage = await page.textContent('.no-results-message');

    return {
      success: true,
      action: "Searched for non-existent event and verified no results",
      extractedData: { message: noResultsMessage },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
